import React, { useState } from 'react';

function Navbar() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleMenuClick = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <div className='text-white flex bg-black justify-between p-8'>
      <div>
        <h1 className='text-xl'>M.Grissa</h1>
      </div>
      <div>
        <i onClick={handleMenuClick} className="fa-solid fa-bars text-xl"></i>
      </div>
      {isMenuOpen && (
        <div className='fixed inset-0 z-999 bg-black flex flex-col items-center justify-center'>
          <a href="/">
            <h1 className='text-5xl'>Home</h1>
          </a>
          <a href="/">
            <h1 className='text-5xl'>Portfolio</h1>
          </a>
          <a href="/">
            <h1 className='text-5xl'>Contact Me</h1>
          </a>
        </div>
      )}
    </div>
  );
}

export default Navbar;
